  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Seney National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1954. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, raptors, fish, and
  disease- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, collections and receipts, and wildfires. Resource
  management is outlined; topics include fur harvesting and timber removal. A progress
  report on field investigations and applied research is included. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, fishing, and violations. N-R forms and photographs are attached.\",\n\t\"license_title\":
